    return (
      <header className={__COMPONENT__} >
        <div className={__COMPONENT__+'__logo'}>
          <Logotype />
        </div>
        <div className={__COMPONENT__+'__login'}>
          <Login />
        </div>
        <div className={__COMPONENT__+'__navigation'}>
            <Navigation />
        </div>

        <div className='header__search-for-city'>

        </div>
      </header>
    );
}

export default Header;
